import React, { Component } from 'react';
import Particles from 'react-particles-js';
import Navigation from './Components/Navigation/Navigation';
import FaceRecognition from './FaceRecognition/FaceRecognition';
import Logo from './Logo/Logo';
import Clarifai from 'clarifai';
import ImageLinkFrom from './ImageLinkForm/ImageLinkForm';
import Rank from './Rank/Rank';
import './App.css';


const app = new Clarifai.App({
  apiKey: '3107cb1329ea4f41a0a0abb9f3afc52f'
});

const particlesOptions = {
  particles: {
                  line_linked: {
                    shadow: {
                      enable: true,
                      color: "#3CA9D1",
                      blur: 5
                    }
                  }
                }
}
class App extends Component {
  constructor(){
    super();
    this.state = {
      input: '',
      imageUrl: ''
    }
  }

  onInputChange=(event)=>{
    this.setState({input: event.target.value});
  }

  onSubmit=()=>{
    this.setState({imageUrl: this.state.input});
    app.models
    .predict(
      Clarifai.FACE_DETECT_MODEL, 
      this.state.input)
    .then(
      function(response) {
        console.log(response.outputs[0]);// do something with response
      },
      function(err) {
        // there was an error
      }
  );
  }



  render() {
  return (
    <div className="App">
      <Particles className = 'particles'
              params={particlesOptions}
      />
      <Navigation />
      <Logo />
      <ImageLinkFrom 
      onInputChange={this.onInputChange} onSubmit={this.onSubmit}/>
      <Rank />
      <FaceRecognition imageUrl={this.state.imageUrl}/>
    </div>
  );
  }
}

export default App;
